import React from 'react';
import ProfileData from '../data/schoolProfiles.json';

function SchoolProfile({match}) {
  console.log(match.params.name);
  return (
    <div>
      {ProfileData.map((school)=>{
        if (school.name == match.params.name){
          return <>
            <div class="card mb-3">
              <img src={school.schoolLogoUrl} class="card-img-top mx-auto" alt="..." style={{width: 150 + 'px', height: 150 + 'px'}}></img>
              <div class="card-body">
                <h5 class="card-title">{school.name}</h5>
                <p class="card-text">This is a wider card with supporting text below as a natural lead-in to additional content. This content is a little bit longer.</p>
                <p class="card-text"><small class="text-muted">Last updated 3 mins ago</small></p>
                <div class="card mb-3" style={{width: 540 + 'px'}}>
                  <div class="row no-gutters">
                    <div class="col-md-4">
                      <img src={school.schoolLogoUrl} class="card-img" alt="..."></img>
                    </div>
                    <div class="col-md-8">
                      <div class="card-body">
                        <h5 class="card-title">Card title</h5>
                        <p class="card-text">This is a wider card with supporting text below as a natural lead-in to additional content. This content is a little bit longer.</p>
                        <p class="card-text"><small class="text-muted">Last updated 3 mins ago</small></p>
                      </div>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </>
        }
      })}
    </div>
  );
};

export default SchoolProfile;
